import React from "react";
import classes from "./Head.module.css";
import Modal from "../UI/Modal";
import CardForm from "../UI/CardForm";
import Button from "../UI/Button";

import { useModal } from "../../Hooks/UseModal";
import logo from "../../imgs/logo.png";

const Head = (props) => {
  const [isOpenLogin, openLogin, closeLogin] = useModal();
  return (
    <header className={classes.header}>
      <h1 className={classes.title}>La Madriguera</h1>
      <div>
        <ion-icon name="paw-outline" class="icon"></ion-icon>
      </div>
      <Button>
        {" "}
        <button onClick={openLogin}>
          {/* <LoginIcon />*/}
          Iniciar sesión
        </button>
      </Button>
      <Modal isOpen={isOpenLogin} closeModal={closeLogin}>
        <img src={logo} alt="logo1" />
        <h2 className={classes.subtitle}>Iniciar sesión</h2>
        <CardForm>
          <form>
            <label>Email</label>
            <input type="text" />
            <label>Password</label>
            <input type="password" />
            <Button>
              <button type="submit">Login</button>
            </Button>
          </form>
        </CardForm>
      </Modal>
      {/*<div className={classes.navbar}>
        <a href="./#">Home</a>
        <a href="./#">About us</a>
        <a href="./#">Login</a>
        <a href="./#">More</a>
  </div>*/}
    </header>
  );
};

export default Head;
